import { Promociones } from './components/Promociones'
import { AppBlackWings } from './components/Principal'
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import { useState } from 'react';
import './App.css';

function App() {
 const [user, setUser] = useState([])

  return (

    <div className="App">
        {
        !user.length > 0
          ? <Promociones setUser={setUser} />
          : <AppBlackWings user={user} setUser={setUser} />  
      }

      <Router>
        <Switch>
          <Route path="/src/components/Principal.jsx" component={AppBlackWings} />
          <Route path="/src/components/Promociones.jsx" component={Promociones} />
        </Switch>
      </Router>
    </div>

  );
}

export default App;
